import "./App.css";
import Counters from "./component/Counters";

function App() {
  return (
    <React.Fragment>
      <nav className="navbar navbar-light bg-light">
        <a className="navbar-brand">Item Counter</a>
      </nav>
      <main className="container">
        <Counters />
      </main>
    </React.Fragment>
  );
}

export default App;
